import React from "react";
import { Grid, Button } from "@material-ui/core";

const tileData = [
  {
    img: "https://picsum.photos/id/0/367/267",
    title: "Galeri 1",
    author: "ba",
  },
  {
    img: "https://picsum.photos/id/0/367/267",
    title: "Galeri 2",
    author: "ba",
  },
  {
    img: "https://picsum.photos/id/0/367/267",
    title: "Galeri 3",
    author: "ba",
  },
];

export default function ManagePengiriman() {
  return (
    <Grid container>
      {tileData.map((item) => {
        return (
          <Grid item xs={12} sm={6}>
            <img src={item.img} alt={item.title} />
            <Button>Upload</Button>
          </Grid>
        );
      })}
    </Grid>
  );
}
